import {Table} from 'react-bootstrap';

export class Main extends Component {

    constructor(props){
        super(props);
        this.state={main:[]}
    }

    render(){
        return(
            <Table className="mt-4" striped bordered hover size="sm">
                <thead>
                    <tr>
                        <th>Employee Id</th>
                        <th>FullName</th>
                        <th>Email</th>
                        <th>Password</th>
                        <th>Mobile</th>
                        <th>Address</th>
                    </tr>
                </thead>
            </Table>
        )
    }
}
